import "./App.css";
import Bgimg from "src/components/Bgimg.js";
import Textsection from "src/components/Textsection.js";
import Footer from "src/components/Footer.js";
function App() {
  return (
    <div className="app">
      <div className="img">
        <Bgimg />
      </div>
      <div className="wrapp">
        <Textsection />
        <Footer />
      </div>
    </div>
  );
}

export default App;
